import './header.css'

export default function Header() {
  return (
    <div className='header'>
    <div className="headerTitles">
        <span className='headerTitleSm'>React & Node</span>
        <span className='headerTitleLg'>Blog</span>
    </div>
    <img className='headerImg' src="https://www.google.com/url?sa=i&url=https%3A%2F%2Fwww.forbes.com%2Fadvisor%2Fbusiness%2Fsoftware%2Fhow-start-travel-blog%2F&psig=AOvVaw1OYy_uVvIgAljkpPEM-fQ6&ust=1697043837138000&source=images&cd=vfe&opi=89978449&ved=0CBEQjRxqFwoTCIDD5Ir764EDFQAAAAAdAAAAABAE" alt="blog" />
    </div>
  )
}
